str = ''
# str = 'dabAcCaCBAcCcaDA'

LOWCASE_LETTERS = ('a'..'z')
UPCASE_LETTERS = ('A'..'Z')

def destroy?(a, b)
  a.downcase == b.downcase && (
    (LOWCASE_LETTERS.include?(a) && UPCASE_LETTERS.include?(b)) ||
    (LOWCASE_LETTERS.include?(b) && UPCASE_LETTERS.include?(a))
  )
end

def compact(str)
  stack = ['']
  str.chars.each do |chr|
    stack << chr
    if destroy?(*stack.last(2))
      stack.pop(2)
    end
  end

  stack.join.length
end

part1 = compact(str)
part2 = str.downcase.chars.uniq.map { |to_remove|
  removed_str = str.delete(to_remove).delete(to_remove.upcase)
  compact(removed_str)
}.min

p [part1, part2]
